<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>[Insert title]</title>
    <style>
    :root {
      --left-main-width: 50%;
      --right-top-main-height: 30%;
      --html-bg-color: #1c1c1c;
      --whitish-color: #E6E1DC;
    }
    
    body, html {
      height: 100%;
      margin: 0;
      background-color: var(--html-bg-color);
      color: var(--whitish-color);
      font: 14px/normal 'Monaco', 'Menlo', 'Ubuntu Mono', 'Consolas', 'source-code-pro', monospace;
    }
        
    
    ::-webkit-scrollbar {
      background-color: var(--html-bg-color);
    }
    ::-webkit-scrollbar-track {
      background-color: var(--html-bg-color);
    }
    ::-webkit-scrollbar-thumb {
      background-color: #404040; 
    }
    ::-webkit-scrollbar-thumb:hover {
      background-color: #505050;
      cursor: pointer;
    }
    
    main {
      display: grid;
      height:100%;
      width:100%;
      
      grid-template: 
      "left cl rthead" 2em
      "left cl rtop"  var(--right-top-main-height)
      "left cl rline" 2px
      "left cl rbhead" 2em
      "left cl rbot" auto 
      / var(--left-main-width) 2px auto;
    }
    
    #left-main {
      grid-area: left;
      overflow: auto;
    }
    
    #right-top-header {
      grid-area: rthead;
      background-color: black;
      border-bottom: 2px solid grey;
      width:100%;
      height:100%;
    }
    
    #right-bot-header {
      grid-area: rbhead;
      background-color: black;
      border-bottom: 2px solid grey;
      width:100%;
      height:100%;
    }
    
    #right-top-main {
      grid-area: rtop;
      overflow: auto;
      padding: 2px;
      white-space: pre;
    }
    
    #right-bot-main {
      grid-area: rbot;
      overflow: auto;
    }
    
    #center-line-main {
    	grid-area: cl;
      background-color: grey;
    }
    
    #right-line-main {
    	grid-area: rline;
      background-color: grey;
    }
    
    #gutter{
      float: left;
      height: 100%;
      width: 4ch;
      padding-right: 1ch;
      background-color: black;
      color: grey;
      text-align: right;
      font: inherit;
      overflow: hidden;
      user-select: none;
    }
    #inner-gutter{
      position: relative;
      top: 0px;
    }
    
    #editor-container {
      position: relative;
      float: right;
      height: 100%;
      width: calc(100% - 5ch);
    }
    
    #editor-backdrop {
      position: absolute;
      height: 100%;
      width: 100%;
      overflow: hidden;
      user-select: none;
      white-space: pre;
    }
    
    #inner-backdrop {
      position: relative;
      top: 0px;
      left: 0px;
    }
    
    #editor-textarea {
      display: block;
      position: absolute;
      height: 100%;
      width: 100%;
      background-color: transparent;
      color: transparent;
      caret-color: white;
      margin: 0;
      padding: 0;
      resize: none;
      border: none;
      outline: none;
      font: inherit;
      white-space: pre;
    }
    
    .status-span {
      display: block;
      float: left;
      padding-left: 2px;
      padding-top: 0.4em;
      white-space: pre;
    }
    
    .button-icon:hover {
      cursor: pointer;
    }
    
    .inactive-button {
      opacity: 0.5;
    }
    
    .inactive-button:hover {
      cursor: auto;
    }
    
    .scale-canvas-up {
        image-rendering: pixelated; /* chrome, safari */
        image-rendering: crisp-edges; /* firefox */
    }
    
    </style>
  </head>
<body>
<main>
  <div id="left-main">
    <div id="gutter" aria-hidden="true">
      <div id="inner-gutter"></div>
    </div>
    <div id="editor-container">
      <div id="editor-backdrop" aria-hidden="true"><div id="inner-backdrop"></div></div>
      <textarea id="editor-textarea" autocomplete="off" spellcheck="false">
      
;;;  Press Ctrl+Enter to run the demo!

(define (gogo a b)
  (goto (- b 500) (- 500 a))
)

(define (nth-digit data n)
  (modulo (quotient (car data) (expt 10 n)) 10)
)

(define (read-data n data ind)
  (cond
    ((>= ind 50) (read-data n (cdr data) (- ind 50)))
    ((= n 1) (nth-digit data ind))
    (else (+
        (* (read-data (- n 1) data (+ ind 1)) 10)
        (nth-digit data ind)
    ))
  )
)

(define (getcolor data ind off)
  (/ (read-data 3 data (+ ind off)) 255)
)

(define (start-polygon data ind)
  (penup)
  (define posa (read-data 3 data ind))
  (define posb (read-data 3 data (+ ind 3)))
  (gogo  posa posb)
  (color (rgb
    (getcolor data ind 6)
    (getcolor data ind 9)
    (getcolor data ind 12)
  ))
  (pendown)
  (begin_fill)
  (list posa posb)
)

(define (draw-from data offset ind posa posb) ;offset is how many we've taken off, as a negative number
  (if (= 0 (modulo ind 1000)) (print ind)) ;to see progress
  (if (> (+ ind offset) 100)(begin
    (define data (cdr data))
    (define offset (- offset 50))
  ))

  (define dig (read-data 1 data (+ ind offset)))
  (cond
    ((= ind (- datalen 1)) (end_fill))
    ((= dig 9)
        (end_fill)
        (define coord (start-polygon data (+ ind offset 1)))
        (draw-from data offset (+ ind 16) (car coord) (car (cdr coord)))
    )
    (else
        (define posa (+ posa (quotient dig 3) -1))
        (define posb (+ posb (modulo   dig 3) -1))
        (gogo posa posb)
        (draw-from data offset (+ ind 1) posa posb)
    )
  )
)



(define (draw)
  (hideturtle)
  (define coord (start-polygon global-data 0))
  (draw-from global-data 0 15 (car coord) (car (cdr coord)))
  (exitonclick))
